import './Card.css'
import PropTypes from 'prop-types'

const Card = ({ num}) => {
    return (
        <div className="card"> <h1>Card</h1>
        </div>
    )
}

Card.propTypes = {
    card: PropTypes.number.isRequired, // Ensure message is a required string
  };

export default Card;
